css:
@-moz-document domain('artificialaiming.net'), url-prefix('https://artificialaiming.net/') {

.alt1 {
background: #8e8e8e;
    color: #000000;
    border-left: 1px solid #FFFFFF;
    border-top: 1px solid #FFFFFF;
}

.alt2 {
    background: #a0a0a0;
    color: #000000;
    border-left: 1px solid #ffffff;
    border-top: 1px solid #FFFFFF;
}

a:link, body_alink {
    color: #000000;
}

.info {
    padding-left: 3px;
    padding-right: 0px;
    padding-top: 3px;
    padding-bottom: 3px;
    background-color: #8a8a8a;
    border-top: 1px solid #505050;
    border-right: 2px solid #505050;
    border-left: 1px solid #505050;
    border-bottom: 2px solid #505050;
    margin-bottom: 3px;
}

.thead {
    background: #00518c;
    color: #000000;
    font: bold 10px tahoma, verdana, geneva, lucida, 'lucida grande', arial, helvetica, sans-serif;
}

.vbmenu_control {
    background: #5D6270;
    color: #000000;
    font: bold 10px tahoma, verdana, geneva, lucida, 'lucida grande', arial, helvetica, sans-serif;
    padding: 3px 6px 3px 6px;
    white-space: nowrap;
}

.time {
    color: #f1f1f1;
}

.panel {
    background: #8e8e8e;
    color: #000000;
    padding: 10px;
    border: 2px outset;
}

.panelsurround {
    background: #333333;
    color: #41444C;
}

textarea, .bginput {
    background: #b5b5b5;
    color: #39393a;
    font: 9pt verdana, geneva, lucida, 'lucida grande', arial, helvetica, sans-serif;
}

.vBulletin_editor {
    background: #6f6f6f;
    padding: 6px;
}

.tcat {
    background: #5D6270;
    color: #000000;
    font: bold 9pt verdana, geneva, lucida, 'lucida grande', arial, helvetica, sans-serif;
}
  
}
